import React from 'react';
import './ServicesPage.css';

const ServicesPage = ({ theme }) => {
  return (
    <div className={`services-page ${theme.toLowerCase()}`}>
      <h1 data-aos="fade-up">Our Services</h1>
      {theme === 'Mafia' && (
        <p data-aos="fade-left" className="mafia-theme">
          Protection and expansion for your business empire.
        </p>
      )}
      {theme === 'Drug Game' && (
        <p data-aos="fade-right" className="drug-game-theme">
          We provide the goods your operation needs.
        </p>
      )}
      {/* Add other themes here */}
    </div>
  );
};

export default ServicesPage;
